	add("research", "{\"term\":\"research\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\"], \"text\":\"Early Modern French \u0027rechercher\u0027 (to examine closely) from Old french (842-ca. 1400) \u0027recerchier\u0027 (to seek, to look for)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Diligent inquiry or examination to seek or revise facts, principles, theories, applications, etc.; laborious or continued search after truth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A particular instance or piece of research\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The dearest interests of parties have frequently been staked on the results of the \u0027\u0027researches\u0027\u0027 of antiquaries\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1747\u0027\u0027, \u0027The Scots magazine\u0027 (volume 9, page 567\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The first step I took in this so necessary a \u0027\u0027research\u0027\u0027, was to examine the motives, the justice, the necessity and expediency of the revolution\", \"priority\":6}]}, \"synonyms\":{}}");

	add("researcher", "{\"term\":\"researcher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who researches\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.theguardian.com/lifeandstyle/2013/jul/08/irregular-bedtimes-affect-childrens-brains Irregular bedtimes may affect children\u0027s passage\u003dIrregular bedtimes may disrupt healthy brain development in young children, according to a study of intelligence and sleeping habits.\u0026amp;nbsp; \u0026amp;para;\u0026amp;nbsp;Going to bed at a different time each night affected girls more than boys, but both fared worse on mental tasks than children who had a set bedtime, \u0027\u0027researchers\u0027\u0027 found\", \"priority\":2}]}, \"synonyms\":{}}");

