	add("resin", "{\"term\":\"resin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027résine\u0027 from Latin \u0027resīna\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A viscous hydrocarbon secretion of many plants, particularly coniferous trees\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of various yellowish viscous liquids or soft solids of plant origin; used in lacquers, varnishes and many other applications; chemically they are mostly hydrocarbons, often polycyclic\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any synthetic compound of similar properties\", \"priority\":3}]}, \"synonyms\":{}}");

	add("residue", "{\"term\":\"residue\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) \u0027residu\u0027 from Latin \u0027residuum\u0027 neuter of \u0027residuus\u0027 (remaining) from \u0027resideō\u0027 (i remain behind)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Whatever remains after something else has been removed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The substance that remains after evaporation, distillation, filtration or any similar process\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Whatever property or effects are left in an estate after payment of all debts, other charges and deduction of what is specifically bequeathed by the testator\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A form of complex number, proportional to the contour integral of a meromorphic function along a path enclosing one of its singularities\", \"priority\":4}]}, \"synonyms\":{}}");

	add("residuum", "{\"term\":\"residuum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027residuum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The residue, remainder or rest of somethin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The solid material remaining after the liquid in which it was dissolved has been evaporated; a residue\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A binary function from [0,1] \u0026amp;times; [0,1] to [0,1] which is defined in terms of the t-norm as follows: \u0026lt;math\u0026gt; x rightarrow y \u003d sup { z z * x leqslant y }\u0026lt;/math\u0026gt;, where \u0026lt;math\u0026gt;*\u0026lt;/math\u0026gt; denotes the t-norm function and \u0026lt;math\u0026gt; sup\u0026lt;/math\u0026gt; denotes the supremum\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027residuum\u0027\u0027 of the minimum t-norm is a function \u0026lt;math\u0026gt; rightarrow\u0026lt;/math\u0026gt; such that \u0026lt;math\u0026gt; x rightarrow y \u003d begin{cases} y, \u0026amp; text{if } x \u0026gt; y 1, \u0026amp; text{if } x leqslant y . end{cases}\u0026lt;/math\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The residue of an estate\", \"priority\":5}]}, \"synonyms\":{}}");

